import React, { useState, useEffect } from 'react';
import NavBarHome from '../Layouts/NavBarHome';
import axios from 'axios';

const Home = () => {
    const user_id = { user_id: 5 };
    const [contacts, setContacts] = useState([]);

    useEffect(() => {
        loadContacts();
    }, []);

    const loadContacts = async () => {
        try {
            const results = await axios.get('http://localhost:8080/contacts/all', {
                params: user_id
            });
            console.log(results.data);
            setContacts(results.data);
        } catch (error) {
            console.error("There was an error fetching the contacts!", error);
        }
    };
  return (
    <div className='container'> 
    <NavBarHome/>
    <div className='contacts-list'>
        <table className="table border shadow">
  <thead>
    <tr>
      <th scope="id">ID</th>
      <th scope="Name">Name</th>
      <th scope="Address">Address</th>
      <th scope="Phone">Phone</th>
      <th scope="DOB">Email</th>
      <th scope="Action">Action</th>
    </tr>
  </thead>
  <tfoot>Co</tfoot>
  <tbody className='table-group-divider'>
{contacts.map((contact,index)=>(
        <tr>
      <th scope="row">{contact.id}</th>
      <td>{contact.name}</td>
      <td>{contact.address}</td>
      <td>{contact.phone}</td>
      <td>{contact.email}</td>
      <tb>
         <button className="btn btn-primary mx-2">Edit</button>
         <button className="btn btn-outline-primary mx-2">View</button>
         <button className="btn btn-danger mx-2">Remove</button>
      </tb>
          </tr>
       ))}

  </tbody>
</table>
    </div>
    </div>
  )
}
export default Home
